//-----------------------------------------
//	CLIENT->SERVER CONTROLS
//-----------------------------------------
//	Controls inside the webpage can emit async events to the server
//	In this example I have a push button and I catch keyboard strokes

/////////
// LISTENERS FOR STEERING AND SPEED
////////
function socket_steering_handler(steeringAngle)
{
	// steeringAngle must be in [-90, 90]
	mysocket.emit("steering", { payload: steeringAngle });
	console.log("Steering angle ", steeringAngle);
}
function socket_speed_handler(speedAngle)
{
	// steeringAngle must be in [-90, 90]
	mysocket.emit("speed", { payload: speedAngle });
	console.log("Speed angle ", speedAngle);
}

/////////
// LISTENERS FOR KEYSTROKE STEERING, SPEED AND STOP
////////
window.document.addEventListener
(
	"keypress",
	function onEvent(event)
	{
		switch (event.key) {
		case ' ':
			mysocket.emit("stop");
			break;
		case 'w':
			mysocket.emit("speed", { payload: 45 });
			break;
		case 's':
			mysocket.emit("speed", { payload: -45 });
			break;
		case 'a':
			mysocket.emit("steering", { payload: -90 });
			break;
		case 'd':
			mysocket.emit("steering", { payload: 90 });
			break;
		default:
			console.log('Sorry, use WASD to move and SPACE to stop.');
		}
		//Inform the server that a key has been pressed
		// mysocket.emit("keyboard", { payload: event.key });
		console.log("Key press..." + event.key);
	}
);






var ROUND_TIME = 30;

$(document).ready(function() {
  var goFS = document.getElementById("goFS");
  goFS.addEventListener("click", function() {
      document.body.requestFullscreen();
  }, false);

	var video  	= document.querySelector('video');
	var canvas 	= document.querySelector('canvas');
	var initAlpha, alpha, steeringAngle, speedAngle;

	window.addEventListener("deviceorientation", function(event) {
		if (!video || !canvas) {
			video = document.querySelector('video');
			canvas = document.querySelector('canvas');

		} else {
			alpha = event.alpha;

			if (initAlpha == undefined) {
				initAlpha = alpha;
			}

			steeringAngle = parseFloat(alpha) - parseFloat(initAlpha);

			if (steeringAngle > 180) {
				steeringAngle -= 180;
				video.style.transform = "rotate(" + String(-steeringAngle) + "deg)";
				canvas.style.transform = "rotate(" + String(-steeringAngle) + "deg)";
				socket_steering_handler(steeringAngle);

			} else {
				video.style.transform = "rotate(" + String(steeringAngle) + "deg)";
				canvas.style.transform = "rotate(" + String(steeringAngle) + "deg)";
				socket_steering_handler(-steeringAngle);
			}
		}
	});

	$(".speed-control").on("input change", function(e) {
		speedAngle = parseInt($(this).val()) * 0.9;
		socket_speed_handler(speedAngle);
		window.navigator.vibrate(Math.abs(speedAngle) * 10);
	})

	var time = 0;
	var timebar = document.querySelector('.timebar-fill');

	var timer = setInterval(function(){
		timebar.style.width = (time/ROUND_TIME)*100 + "%";
		time += 1;

		if (time == ROUND_TIME) {
			clearInterval(timer)
			timebar.style.width = "100%";
			window.navigator.vibrate([1000, 300, 300, 300, 2000]);
		}
	}, 1000);
})
